import './App.css';

import {HOME} from "./mainpage/Page";
import {Route} from "react-router-dom";
import { Link } from 'react-router-dom';



function App() {
  return (
    <div>
        <Route path="/" component={HOME}/>
        <Route path="/cpp" component={HOME}/>
        <Route path="/html" component={HOME}/>
        <Route path="/javascript" component={HOME}/>
        <Route path="/typescript" component={HOME}/>
        <Route path="/java" component={HOME}/>
        <Route path="/python" component={HOME}/>
    </div>
  );
}


export default App;
